import React from 'react';

const Experience = () => {
  const experiences = [
    {
      title: 'Senior Software Engineer',
      company: 'Tech Company',
      period: '2022 - Present',
      description: 'Led development of full-stack applications using React, Node.js, and AWS. Implemented CI/CD pipelines and mentored junior developers.',
    },
    {
      title: 'Data Scientist',
      company: 'AI Solutions',
      period: '2020 - 2022',
      description: 'Developed machine learning models for predictive analytics. Worked with large datasets and implemented data visualization solutions.',
    },
    {
      title: 'Software Developer',
      company: 'Startup Inc',
      period: '2018 - 2020',
      description: 'Built and maintained web applications using modern frameworks. Collaborated with cross-functional teams to deliver features.',
    },
  ];

  return (
    <div className="min-h-screen flex flex-col justify-center items-center px-4">
      <h2 className="text-4xl font-bold text-white mb-8">Experience</h2>
      <div className="max-w-4xl w-full">
        {experiences.map((exp, index) => (
          <div
            key={index}
            className="relative pl-8 pb-8 border-l-2 border-blue-500 last:border-l-0"
          >
            <div className="absolute left-0 top-0 w-4 h-4 bg-blue-500 rounded-full -translate-x-1/2" />
            <div className="bg-gray-800 p-6 rounded-lg">
              <h3 className="text-xl font-semibold text-white mb-2">{exp.title}</h3>
              <p className="text-blue-400 mb-2">{exp.company}</p>
              <p className="text-gray-400 mb-4">{exp.period}</p>
              <p className="text-gray-300">{exp.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Experience;
